function updatePreview(template) {
    const form = document.getElementById('editor-form');
    const category = form.dataset.category;
    let text = template.text;

    // --- Dynamic Data Mapping ---
    let hostName = '';
    let partnerName = '';
    let finalHostNameDisplay = '';
    let extraInfo = [];
    let customMsg = form.querySelector('[name="message"]').value;

    const section = document.getElementById(`form-${category}`) || document.getElementById('form-generic');

    // Harvest data from active section
    if (category === 'wedding') {
        let groom = section.querySelector('[name="groom_name"]').value;
        let bride = section.querySelector('[name="bride_name"]').value;

        hostName = groom;
        partnerName = bride;

        // CRITICAL: Join names if both exist
        if (bride && groom) {
            finalHostNameDisplay = `${groom} & ${bride}`;
        } else {
            finalHostNameDisplay = groom || bride || 'Groom & Bride';
        }

        const gParent = section.querySelector('[name="groom_parents"]').value;
        const bParent = section.querySelector('[name="bride_parents"]').value;

        if (gParent) extraInfo.push(`Groom's Parents: ${gParent}`);
        if (bParent) extraInfo.push(`Bride's Parents: ${bParent}`);

        // Image Logic for Wedding (Split)
        const groomInput = section.querySelector('#groom-photo-upload');
        const brideInput = section.querySelector('#bride-photo-upload');
        const groomUrl = groomInput ? groomInput.dataset.url : '';
        const brideUrl = brideInput ? brideInput.dataset.url : '';

        const previewHeader = document.querySelector('.preview-header');
        if (previewHeader) {
            if (groomUrl && brideUrl) {
                // Split Layout
                previewHeader.innerHTML = `
                    <div style="display: flex; gap: 5px; height: 200px;">
                        <img src="${groomUrl}" style="width: 50%; height: 100%; object-fit: cover; border-radius: var(--radius-md) 0 0 var(--radius-md);">
                        <img src="${brideUrl}" style="width: 50%; height: 100%; object-fit: cover; border-radius: 0 var(--radius-md) var(--radius-md) 0;">
                    </div>`;
                previewHeader.style.display = 'block';
                document.getElementById('background_style').value = template.frame || '';
                document.getElementById('background_image_url').value = `${groomUrl}|${brideUrl}`;

            } else if (groomUrl || brideUrl) {
                // Single Image
                const url = groomUrl || brideUrl;
                previewHeader.innerHTML = `<img src="${url}" style="width: 100%; height: 200px; object-fit: cover; border-radius: var(--radius-md);">`;
                previewHeader.style.display = 'block';
                document.getElementById('background_image_url').value = url;
                document.getElementById('background_style').value = template.frame || '';
            } else {
                // Placeholder/Template Image
                if (template.image) {
                    previewHeader.innerHTML = `<img src="${template.image}" style="width: 100%; height: 200px; object-fit: cover; border-radius: var(--radius-md); display: block;">`;
                    previewHeader.style.display = 'block';
                } else {
                    previewHeader.innerHTML = '';
                    previewHeader.style.display = 'none';
                }
            }
        }

    } else if (category === 'birthday') {
        hostName = section.querySelector('[name="bday_person"]').value;
        const age = section.querySelector('[name="age"]').value;
        const theme = section.querySelector('[name="theme"]').value;

        if (age) text = text.replace('BIRTHDAY', `${age.toUpperCase()} BIRTHDAY`);
        if (theme) extraInfo.push(`Theme: ${theme}`);

        // Generic Image
        handleGenericPreviewImage(section);

    } else if (category === 'anniversary') {
        hostName = section.querySelector('[name="couple_names"]').value;
        const years = section.querySelector('[name="years_together"]').value;
        if (years) extraInfo.push(`Celebrating ${years}`);

        handleGenericPreviewImage(section);

    } else if (category === 'baby') {
        hostName = section.querySelector('[name="parents_name"]').value;
        const babyName = section.querySelector('[name="baby_name"]').value;
        const gender = section.querySelector('[name="baby_gender"]').value;
        const theme = section.querySelector('[name="theme"]').value;

        if (babyName) extraInfo.push(`Baby ${babyName}`);
        if (gender) extraInfo.push(`It's a ${gender}!`);
        if (theme) extraInfo.push(`Theme: ${theme}`);

        handleGenericPreviewImage(section);
    }

    function handleGenericPreviewImage(sec) {
        const input = sec.querySelector('.generic-photo-upload');
        const url = input && input.dataset.url ? input.dataset.url : (template.image || '');
        const previewHeader = document.querySelector('.preview-header');

        if (url) {
            previewHeader.innerHTML = `<img src="${url}" style="width: 100%; height: 200px; object-fit: cover; border-radius: var(--radius-md);">`;
            document.getElementById('background_image_url').value = url;
            if (document.getElementById('background_style')) {
                document.getElementById('background_style').value = template.frame || '';
            }
            if (previewHeader) previewHeader.style.display = 'block';
        } else {
            if (previewHeader) {
                previewHeader.innerHTML = '';
                previewHeader.style.display = 'none';
            }
        }
    }


    // Sync to Hidden Fields
    // Prepend parents/extra info to host name for "Above Names" visibility
    let syncHostName = hostName;
    if (extraInfo.length > 0) {
        syncHostName = extraInfo.join('\n') + '\n\n' + (finalHostNameDisplay || hostName);
    } else {
        syncHostName = finalHostNameDisplay || hostName;
    }

    if (document.getElementById('final_host_name')) {
        document.getElementById('final_host_name').value = syncHostName;
    }
    if (document.getElementById('final_partner_name')) {
        document.getElementById('final_partner_name').value = partnerName;
    }

    // --- Placeholders Replacement ---
    // Injecting the modified host string (with parents) into the template
    text = text.replace(/{{host_name}}/g, syncHostName || (category === 'wedding' ? 'Groom Name' : 'Host Name'));
    text = text.replace(/{{partner_name}}/g, partnerName || (category === 'wedding' ? 'Bride Name' : ''));
    text = text.replace(/{{event_date}}/g, form.querySelector('[name="event_date"]').value || 'Date');
    text = text.replace(/{{event_time}}/g, form.querySelector('[name="event_time"]').value || 'Time');
    text = text.replace(/{{venue}}/g, form.querySelector('[name="venue"]').value || 'Venue');

    // Custom Message goes at end
    if (customMsg) text += `\n\n${customMsg}`;

    // Update DOM
    document.getElementById('preview-title').textContent = template.title;
    document.getElementById('preview-text').textContent = text;

    document.getElementById('preview-date').textContent = form.querySelector('[name="event_date"]').value || 'Date';
    document.getElementById('preview-time').textContent = form.querySelector('[name="event_time"]').value || 'Time';
    document.getElementById('preview-venue').textContent = form.querySelector('[name="venue"]').value || 'Venue';



    // Update Style text color
    const darkKeywords = ['midnight', 'neon', 'dark', 'purple', 'teal', 'ruby', 'forest', 'charcoal', 'night', 'ocean', 'black', 'navy', 'deep', 'luxury', 'royal', 'premium'];
    const isDark = darkKeywords.some(k => template.id.includes(k));
    const textColor = isDark ? '#f3f4f6' : '#1f2937';

    document.getElementById('preview-text').style.color = textColor;
    document.getElementById('preview-title').style.color = textColor;

    // Fix When/Where box visibility
    const box = document.getElementById('preview-details-box');
    if (box) {
        if (isDark) {
            box.style.background = 'rgba(255, 255, 255, 0.1)';
            box.style.color = '#f3f4f6';
        } else {
            box.style.background = 'var(--bg-light)';
            box.style.color = '#1f2937';
        }
        // Ensure all child text elements (p, span, strong) use the correct color
        box.querySelectorAll('p, span, strong').forEach(el => {
            el.style.color = isDark ? '#f3f4f6' : '#1f2937';
        });
    }

    // ROBUSTNESS: Always ensure background_style hidden input is set to frame if available
    // (and not already set by valid image logic)
    const bgInput = document.getElementById('background_style');
    if (bgInput && template.frame && !bgInput.value) {
        bgInput.value = template.frame;
        updatePreviewBackground(template.frame);
    } else if (bgInput && template.frame && bgInput.value === template.frame) {
        // Re-apply visual just in case
        updatePreviewBackground(template.frame);
    }
}

// --- NEW Helper: Background Frame Logic ---
function updatePreviewBackground(frameUri) {
    const container = document.querySelector('.invite-preview-content');
    if (!container) return;

    if (frameUri) {
        container.style.backgroundImage = `url("${frameUri}")`;
        container.style.backgroundSize = '100% 100%';
        container.style.backgroundPosition = 'center';
        container.style.backgroundRepeat = 'no-repeat';
        container.style.padding = '2rem';
        // Ensure hidden input is updated if not already
        const bgInput = document.getElementById('background_style');
        if (bgInput) bgInput.value = frameUri;
    } else {
        container.style.backgroundImage = 'none';
        container.style.padding = '0';
    }
}


