// --- Custom Dropdown Toggle (No Bootstrap Dependency) ---
window.toggleCustomDropdown = function () {
    const menu = document.getElementById('customDownloadMenu');
    if (menu.style.display === 'none' || menu.style.display === '') {
        menu.style.display = 'block';
    } else {
        menu.style.display = 'none';
    }

    // Auto-close when clicking outside
    document.addEventListener('click', function closeMenu(e) {
        if (!e.target.closest('#customDownloadBtn') && !e.target.closest('#customDownloadMenu')) {
            menu.style.display = 'none';
            document.removeEventListener('click', closeMenu);
        }
    });
};

window.downloadPreview = async function (format) {
    const originalElement = document.getElementById('preview-container');
    const title = document.querySelector('input[name="title"]').value || 'invitation';
    const btn = document.getElementById('customDownloadBtn'); // New ID

    const originalText = btn.innerHTML;
    // UI Feedback
    btn.innerHTML = '<i class="fas fa-spinner fa-spin"></i> Processing...';
    btn.disabled = true;

    // Close menu immediately
    document.getElementById('customDownloadMenu').style.display = 'none';

    const cleanup = () => {
        btn.innerHTML = originalText;
        btn.disabled = false;
    };

    try {
        console.log("Starting download capture...");

        // --- 1. CAPTURE ---
        // Use html2canvas directly. It is the most robust for this use case.
        // We clone to ensure "A4" sizing if needed, but for now we capture 'as is' 
        // or we temporarily enforce a width. 
        // Let's capture the live element to avoid 'missing map' issues with clones.

        const canvas = await html2canvas(originalElement, {
            scale: 2, // High Res
            useCORS: true, // ESSENTIAL for Map Tiles
            allowTaint: false,
            backgroundColor: '#ffffff',
            logging: true,
            onclone: (clonedDoc) => {
                // Ensure the cloned map has dimensions
                const clonedMap = clonedDoc.getElementById('map');
                if (clonedMap) clonedMap.style.width = '100%';
            }
        });

        const imgData = canvas.toDataURL('image/png');
        const cleanTitle = title.replace(/[^a-z0-9-_]/gi, '_');

        // --- 2. FORMAT ---
        if (format === 'png') {
            const link = document.createElement('a');
            link.download = `${cleanTitle}.png`;
            link.href = imgData;
            document.body.appendChild(link);
            link.click();
            document.body.removeChild(link);

        } else if (format === 'pdf') {
            const { jsPDF } = window.jspdf;

            // Calculate A4 Ratio
            const a4Width = 210; // mm
            const a4Height = 297; // mm
            const pdf = new jsPDF('p', 'mm', 'a4');

            const elementWidth = canvas.width;
            const elementHeight = canvas.height;

            // Fit width to A4
            const finalWidth = a4Width;
            const finalHeight = (elementHeight * a4Width) / elementWidth;

            pdf.addImage(imgData, 'PNG', 0, 0, finalWidth, finalHeight);
            pdf.save(`${cleanTitle}.pdf`);

        } else if (format === 'word') {
            // Word Embed Fix (Client-Side)
            const wordHTML = `
                <html xmlns:o='urn:schemas-microsoft-com:office:office' xmlns:w='urn:schemas-microsoft-com:office:word' xmlns='http://www.w3.org/TR/REC-html40'>
                <head><meta charset='utf-8'><title>${title}</title></head>
                <body>
                    <div style="text-align: center;">
                        <img src="${imgData}" width="600" style="width:100%; max-width:600px;">
                    </div>
                </body>
                </html>
            `;
            const blob = new Blob(['\ufeff', wordHTML], { type: 'application/msword' });
            saveAs(blob, `${cleanTitle}.doc`);
        }

    } catch (err) {
        console.error("Download failed:", err);
        alert("Error generating download: " + err.message);
    } finally {
        cleanup();
    }
};

window.setPreviewMode = function (mode) {
    const container = document.getElementById('preview-container');

    // Remove all existing mode classes
    container.classList.remove('mobile', 'desktop', 'a4');

    // Add new mode
    container.classList.add(mode);

    // Update buttons
    document.querySelectorAll('.preview-controls .btn').forEach(btn => {
        btn.classList.remove('active');
        if (btn.textContent.toLowerCase().includes(mode) ||
            (mode === 'a4' && btn.textContent.toLowerCase().includes('print'))) {
            btn.classList.add('active');
        }
    });
};

// Old renderGallery removed - new one implemented above

function renderIframeMap(container, address) {
    const iframe = document.createElement('iframe');
    iframe.width = "100%";
    iframe.height = "100%";
    iframe.style.border = "0";
    iframe.loading = "lazy";
    iframe.allowFullscreen = true;
    iframe.src = `https://maps.google.com/maps?q=${encodeURIComponent(address)}&t=&z=15&ie=UTF8&iwloc=&output=embed`;
    container.innerHTML = '';
    container.appendChild(iframe);
}

